package Sorting;

import java.util.HashMap;
import Sorting.SortFrequency;

public class SortCharFrequency {

    public static HashMap<Character,SortFrequency> hm;


    public static int partition(char[] arr, int lo, int hi){
        char pivot = arr[hi];
        int i = lo - 1;

        for(int j = lo; j < hi  ; j++ ){
            // check count
            if(hm.get(arr[j]).count > hm.get(pivot).count){
                i++;
                char temp = arr[i];
                arr[i] = arr[j];
                arr[j] = temp;
            }
            else if(hm.get(arr[j]).count == hm.get(pivot).count){
                if(arr[j] < pivot ){
                    i++;
                    char temp = arr[i];
                    arr[i] = arr[j];
                    arr[j] = temp;
                }
                else if(hm.get(arr[j]).index < hm.get(pivot).index){
                    i++;
                    char temp = arr[i];
                    arr[i] = arr[j];
                    arr[j] = temp;
                }

            }
        }

        i++;
        char temp = arr[i];
        arr[i] = arr[hi ];
        arr[hi] = temp;


        return i;
    }

    public static void quickSort(char[] a, int lo, int hi){
        if(lo < hi){
            int pivot = partition(a,lo,hi);
            quickSort(a,lo,pivot - 1);
            quickSort(a,pivot + 1, hi);
        }
    }

    public static void merge(char[] a, char[] temp, int lo, int mid, int hi){




        for(int k = lo; k <= hi; k++) temp[k] = a[k];
        int i = lo, j =  mid + 1;
        for(int k = lo; k <= hi; k++) {
            if(i > mid) a[k] = temp[j++];
            else  if(j > hi) a[k] = temp[i++];
            else if (hm.get(temp[j]).count == hm.get(temp[i]).count){
                if (hm.get(temp[j]).index != hm.get(temp[i]).index) {
                    if (Character.compare(temp[i], temp[j]) < 0) a[k] = temp[i++];
                    else a[k] = temp[j++];
                }else{
                    if (hm.get(temp[j]).index > hm.get(temp[i]).index) a[k] = temp[i++];
                    else  a[k] = temp[j++];

                }


            }
            else if(hm.get(temp[j]).count < hm.get(temp[i]).count) a[k] = temp[j++];
            else a[k] = temp[i++];
        }
    }

    // mergesort a[lo..hi] using auxiliary array aux[lo..hi]
    private static void sort(char[] a, char[] aux, int lo, int hi) {
        if (hi <= lo) return;
        int mid = lo + (hi - lo) / 2;
        sort(a, aux, lo, mid);
        sort(a, aux, mid + 1, hi);
        merge(a, aux, lo, mid, hi);
    }

    public static void sort(char[] a) {
        char[] aux = new char[a.length];
        sort(a, aux, 0, a.length-1);

    }

    public static void main(String[] args){
        String input = "";
        char[] a = input.toCharArray();
//        quickSort(a,0,a.length - 1);
//        for(int n: a) System.out.print(n + " ");
        hm =  new HashMap<>();
        for( int i = 0; i < a.length; i++){
            if(hm.containsKey(a[i])){
                SortFrequency t = hm.get(a[i]);
                t.count++;
            }

            if(!hm.containsKey(a[i]))     hm.put(a[i], new SortFrequency(1,i));


        }

        System.out.println();
        quickSort(a,0,a.length - 1);
        for(char c: a) System.out.print(c + " ");
        String output = new String(a);
       System.out.println(output);
       System.out.print('t' > 'r');
    }
}

